import React, { useState } from 'react';
import { postData } from '../api';
import { useNavigate } from 'react-router-dom';

const DodajMieszkaniec = ({ isAdmin }) => {
    const [formData, setFormData] = useState({
        username: '',
        first_name: '',
        last_name: '',
        adres: '',
        telefon: '',
        email: '',
        password: ''
    });
    const [error, setError] = useState(null);
    const navigate = useNavigate();

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await postData('users/', formData);
            navigate('/mieszkaniec'); // Przekierowanie po dodaniu mieszkańca
        } catch (err) {
            console.error("Error adding resident:", err);
            setError("Nie udało się dodać mieszkańca.");
        }
    };

    return (
        <div style={styles.container}>
            <h1 style={styles.heading}>Dodaj Mieszkańca</h1>
            {error && <p style={styles.error}>{error}</p>}
            <form onSubmit={handleSubmit} style={styles.form}>
                <input
                    type="text"
                    name="username"
                    value={formData.username}
                    onChange={handleChange}
                    placeholder="Username"
                    style={styles.input}
                    required
                />
                <input
                    type="text"
                    name="first_name"
                    value={formData.first_name}
                    onChange={handleChange}
                    placeholder="First Name"
                    style={styles.input}
                    required
                />
                <input
                    type="text"
                    name="last_name"
                    value={formData.last_name}
                    onChange={handleChange}
                    placeholder="Last Name"
                    style={styles.input}
                    required
                />
                <input
                    type="text"
                    name="adres"
                    value={formData.adres}
                    onChange={handleChange}
                    placeholder="Adres"
                    style={styles.input}
                    required
                />
                <input
                    type="text"
                    name="telefon"
                    value={formData.telefon}
                    onChange={handleChange}
                    placeholder="Telefon"
                    style={styles.input}
                    required
                />
                <input
                    type="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    placeholder="Email"
                    style={styles.input}
                    required
                />
                <input
                    type="password"
                    name="password"
                    value={formData.password}
                    onChange={handleChange}
                    placeholder="Password"
                    style={styles.input}
                    required
                />
                <div style={styles.buttonContainer}>
                    <button type="submit" style={styles.buttonPrimary}>
                        Dodaj Mieszkańca
                    </button>
                    <button
                        type="button"
                        style={styles.buttonSecondary}
                        onClick={() => navigate('/mieszkaniec')}
                    >
                        Anuluj
                    </button>
                </div>
            </form>
        </div>
    );
};

const styles = {
    container: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        height: '100vh', // Pełna wysokość widoku
        backgroundColor: '#f9f9f9',
        padding: '20px',
    },
    heading: {
        fontSize: '2rem',
        marginBottom: '20px',
    },
    error: {
        color: 'red',
        marginBottom: '10px',
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
        width: '100%',
        maxWidth: '400px', // Maksymalna szerokość formularza
        backgroundColor: 'white',
        padding: '20px',
        borderRadius: '8px',
        boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    },
    input: {
        marginBottom: '15px',
        padding: '10px',
        fontSize: '1rem',
        border: '1px solid #ccc',
        borderRadius: '4px',
        width: '100%',
    },
    buttonContainer: {
        display: 'flex',
        justifyContent: 'space-between',
    },
    buttonPrimary: {
        padding: '10px 20px',
        fontSize: '1rem',
        backgroundColor: '#007bff',
        color: 'white',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
    },
    buttonSecondary: {
        padding: '10px 20px',
        fontSize: '1rem',
        backgroundColor: '#6c757d',
        color: 'white',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
    },
};

export default DodajMieszkaniec;
